import React, { Component } from "react";

class Toc extends Component {
  render() {
    console.log("Toc");
    // const lists = [];
    let data = this.props.data;

    data = data.map((el) => {
      return (
        <li key={el.id}>
          <a
            href={"/content/" + el.id}
            onClick={(e) => {
              e.preventDefault();
              this.props.onChangePage(e.target.dataset.id);
            }}
          >
            {el.title}
          </a>
        </li>
      );
    });
    // lists.push(
    //   <li key={data[i].id}>
    //     <a
    //       href={"/content/" + data[i].id}
    //       onClick={(e) => {
    //         e.preventDefault();
    //         this.props.onChangePage();
    //       }}
    //     >
    //       {data[i].title}
    //     </a>
    //   </li>
    // );

    return (
      <nav>
        <ul>{data}</ul>
      </nav>
    );
  }
}

export default Toc;
